import React, {Component} from 'react'

class Cart extends Component{

render() {
    const products = this.props.cartList;
return (
    <div className = "container">
        <div className = "col-xs-12">
        <h1>Your current cart: </h1>  
        {products.map(e =>
              <div>
                {e.title} {e.id} {e.userId}
               </div> 
              )}
        </div>
       
    </div>
);

}


}

export default Cart;
